oxy_webhelp_navlinks = {"digital_banking_main_solution-d4216e23":{"topics":[{"title":"Digital banking building blocks ","shortdesc":"<p class=\"shortdesc\">Finshape’s main product is a custom Digital Banking solution. “Custom” in this         context refers to a specific configuration of the provided building blocks (functional         capabilities) combined with developing front-end applications and selected add-ons from         scratch. These building blocks are not standalone products but rather DBOS infrastructure         elements, DBOS components, connectors (APIs), tools, and applications from which the final         product can be assembled.<\/p>","href":"topics\/db_modules.html","attributes":{"data-id":"db_modules"},"menu":{"hasChildren":true},"tocID":"db_modules-d4216e34","next":"db_modules-d4216e34"},{"title":"Finshape products ","shortdesc":"<p class=\"shortdesc\">This section describes all products that are being delivered to the client. Here we         describe products from the business point of view. Value Proposition is a primary component         of the business model. This is a description of the goods or services that a company offers         and why they are desirable to customers or clients. <\/p>","href":"topics\/finshape_products_clients_pay_for.html","attributes":{"data-id":"finshape_products_clients_pay_for"},"menu":{"hasChildren":true},"tocID":"finshape_products_clients_pay_for-d4216e1030","next":"finshape_products_clients_pay_for-d4216e1030"}]}};